  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108235 includes chemical,
  meteorological, physical and underway - surface data collected from XUE LONG in
  the Bali Sea, Celebes Sea, East China Sea (Tung Hai), Indian Ocean, Java Sea, Makassar
  Strait, Philippine Sea, Rio de la Plata, Sea of Japan and South Atlantic Ocean from
  2007-11-12 to 2008-04-12 and retrieved during cruise 76XL20071112 (Xue_Long_Chinare_24).
  These data include BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL
  PRESSURE - DIFFERENCE, Partial pressure (or fugacity) of carbon dioxide, SALINITY
  and SEA SURFACE TEMPERATURE. The instruments used to collect these data include
  Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous
  carbon dioxide (CO2) measurement. These data were collected by Liqi Chen and Zhongyong
  Gao of State Ocean Administration; Third Institute of Oceanography, Rik Wanninkhof
  of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory and Wei-Jun
  Cai of University of Georgia; School of Marine Programs as part of the VOS_Xue_Chinare_24
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
